function App() {

  const theme = useContext(ThemeConext)
  const darkMode = theme.state.darkMode;

  return (
    // <div style={{backgroundColor:darkMode ? "#222" : "white", color:darkMode && white}}>
    <div>
    <ThemeProvider>
    <Darkmode/>
    <Intro/>
    <About/>
    <ProductList/>
    <Contact/>
    </ThemeProvider>
    </div>
  );
}

export default App;
